import React from "react";
import { Button } from "@mui/material";
import { Link } from "react-router-dom";

class NavbarLogin extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            authenticated: false,
            registered:false,
            registerpage:false,
            loginpage:true,
            token: null,
            email: "",
            password: "",
            userign: "",
            userFirst: "",
            userLast: "",
            error: "",
        }
    }


    render() {
        return(
            <div> working </div>
        )
    }
}
export default NavbarLogin;
